        this.name = name,
        this.description = description,
        this.url = url,
        this.logo = logo
    }
}

const react = new Tech("React.js", "tech description", "", reactLogo)
techDisplay.push(react)

techDisplay.forEach((tech) => {
    let div = 
        <div className="blurb">
            <img src={tech.logo} alt="techLogo"></img>
            <h5>{tech.name}</h5>
            <p>{tech.description}</p>
            <input type={"button"} value="See Degrees" />
        </div>

    divArray.push(div)
}
    
)

